    constructor(props){
        super(props);
        this.state = {
            degrees: {},
            loaded: false
        }
    }

    render(){
        const {degrees, loaded} = this.state;

        const paneData = [
            {
              title: 'Graduate',
              group: degrees.graduate
            },
            {
              title: 'Undergraduate',
              group: degrees.undergaduate
            }
        ];

        const panes = paneData.map(({ title, group }) => {


            {
            <div className='tab'> 
            <Tab.Pane>
                <AllPeople activeClass="activeTab" title={title} pepGroup={group}/>
            </Tab.Pane> 
            </div>

          }


        return(
          <div>{title}</div>
        )

    });

    return(
        <div className='optionTabs'>
            <div className="subTitle"><h2>Degrees</h2></div>

            <Tab panes={panes} />
        </div>

    );
    // return {
    //     menuItem: title,
    //     render: renderPane(menuItem, index, group)
    //   }

    }
    componentDidMount(){
        getData('degrees/')
            .then((json) => {
                this.setState({
                    degrees:json,
                    loaded: true
                })
            })
    }
}
